#momandson #purelove #unconditionallove ğŸ˜";}i:30;a:1:{s:14:"comments_count";i:0;}i:31;a:1:{s:11:"likes_count";i:0;}i:32;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEuu12Kht5s";}i:33;a:1:{s:5:"image";s:249:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/p1080x1080/118780117_641571746497322_7233946300484594251_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=102&_nc_ohc=SG9d1IWb4T8AX8Z5PJC&oh=b76b5af396a823d4dd0d80d34491da05&oe=5F7A57E0";}i:34;a:1:{s:4:"type";s:5:"image";}i:35;a:1:{s:8:"owner_id";i:231377277;}i:36;a:1:{s:14:"owner_username";s:0:"";}i:37;a:1:{s:14:"owner_fullname";s:0:"";}i:38;a:1:{s:9:"owner_pic";s:0:"";}i:39;a:1:{s:2:"id";s:19:"2391053959227119769";}i:40;a:1:{s:10:"short_code";s:11:"CEuuuhWhhiZ";}i:41;a:1:{s:12:"created_time";i:1599255865;}i:42;a:1:{s:7:"caption";s:2181:"So you're on board with this whole gentle parenting thing. You love it, you're learning new ideas, you're doing it with your kids, and you're already seeing results. But then dad comes home. He's not been reading Whole Brained Child, so far as he knows gentle parenting just means "we don't spank anymore," and he's getting the same connection crushing, relationship repelling results every time he has to discipline the kids. He sees you doing different things and getting better results, but he can't figure out how to do what you're doing.

Here's a non-secret: most parenting books are read by moms. Dads tend to fly more by the seat of their pants, leaning on their own childhood experiences, and gathering in drips and drabs of information from a variety of sources (including his wife who's reading parenting books). As long as things are going fairly fine, we're ok with this scenario. After all, we've got work to do, yards to mow, T-ball games to attend, and once we've covered all our responsibilities, we'd love to unwind by watching a little SportsCenter. Never does unwinding include reading Heartfelt Discipline.

So what to do? You could try sitting him down and laying out a case for switching to gentle parenting. That will work for some dads. They'll hop on board with gentle parenting and ride towards the sunset. If this is you, please don't brag. Some of the other moms are super jelly.

Here's a more incremental approach. Try telling him this:

"Youâ€™re a good man, and I know you want a good relationship with our children. I know you want to be respected. Here are two specific things you could begin doing to achieve that. Will you try these two things, just for the next week, and weâ€™ll see if it changes things?"

Notice what we're doing here:
1. Acknowledging he's a good man. Most dads are good guys, even when we're not the best dad we could be.
2. Concrete steps. Specific actions in specific scenarios. Don't give theory, lay out the words and actions you want him to try.
3. Limited timeframe. This is about trying a new idea to see if it works better, not adopting an entire new approach to parenting.

